import React from "react";
import styles from "./Dialogs.module.css";
import { NavLink } from "react-router-dom";
import { Route, Routes} from 'react-router-dom'
import { DialogBase } from "./DialogBase";


const DialogItem = ({ name }) => {
  return (
    <>
      <div className={styles.item}>
        <NavLink
          to="messages/"
          className={({ isActive }) => (isActive ? styles.active : undefined)}
        ><p>{name}</p>
        </NavLink>
      </div>
    </>
  );
};

const DialogWindow = () => {
  return(
    <>
    <article>
      <h1>name</h1>
    </article>
    </>
  )
}

export default function Dialogs() {
  return (
    <>
<Routes className={styles.content}>
       <Route path='/Messages/1' Component={DialogBase[0].name}/>
       <Route path='/Messages/2' Component={DialogBase[1].name}/>
       <Route path='/Messages/3' Component={DialogBase[2].name}/>
       <Route path='/Messages/4' Component={DialogBase[3].name}/>
       <Route path='/Messages/5' Component={DialogBase[4].name}/>
       </Routes>
    </>
  );
}
